      SELECT ALL + + col0 FROM tab1 (FORMAT parquet) WHERE + col1 * col1 + + - ( col2 ) * + - 91 / col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q9134.out
    data: |
      51
      85
      91
